import React, {Component} from "react";
import './Navbar.css'

class Navbar extends Component {
    render(){
        return (
            <div className="nav">
                <h2>MyPortfolio</h2> <ul style={{display : 'inline'}}>
                    <li>
                        About Me
                    </li>
                        Services
                    <li>
                        Portfolio
                    </li>

                    <li>
                        Skillset
                    </li>

                    <li>
                        Contact Me
                    </li>
                </ul>
            </div>
        );
    }
}
export default Navbar;
